import React from "react";
import "./Subject.css";
import {Link} from "react-router-dom";
import {Alert} from "react-native";

function Subject(props){

    const createAlert = () => Alert.alert(
        "Are you sure you want to proceed for mock quiz",
        "My Alert Msg",
        [
            {
                text: "Ask me later",
                onPress: () => console.log("Ask me later pressed")
            },
            {
                text: "Cancel",
                onPress: () => console.log("Cancel Pressed"),
                style: "cancel"
            },
            { text: "OK", onPress: () => console.log("OK Pressed") }
        ],
        { cancelable: false }
    );

    return(
        <div className={"subject "+ (props.info.open ? "open": "")}
            key={props.index}
             onClick={()=>props.toggleSubject(props.index)}
        >
            <div className={"subject__heading"}>
                {props.info.subject}
            </div>
            <div className={"subject__topics"}>
                {
                    props.info.chapters.map((chapter, i) =>{
                        return(
                            // <Link to={"/quiz"} className={"subject__topics__link"}>
                                <span onClick={createAlert}>
                                    {chapter}
                                </span>
                            // </Link>

                        );
                    })
                }
            </div>
        </div>
    );
}
export default Subject;
